func lengthOfLongestSubstring(s string) int {
	return longest(s, 0, 0, 0, make(map[string]bool))
}

func longest(s string, offset, index, counter int, seen map[string]bool) int {
	if index >= len(s) {
		return 0
	}

	var subLen int

	if _, ok := seen[fmt.Sprint(offset, "-", s[index])]; ok {
		subLen = longest(s, offset+1, offset+1, 0, seen)
	} else {
		seen[fmt.Sprint(offset, "-", s[index])] = true
		counter++
		subLen = longest(s, offset, index+1, counter, seen)
	}

	return max(subLen, counter)
}

func max(a, b int) int {
	if a > b {
		return a
	}
	return b
}
